import { Background, Container } from "./style";

const Main = () => {
    return(
        <Background>
            <Container>
                <div>
                    <div class ='line_one'>
                    <button>Rodizio</button>
                    <button>Happy Hour</button>
                    </div>
                </div>

            </Container>  
        </Background>
    );
}

export default Main;
